syntax = "proto3";
package POGOProtos.Rpc;

message AsyncFileUploadCompleteOutProto {
	enum ErrorStatus {
		UNSET = 0;
		SERVER_UPDATE_FAILED = 1;
		MISSING_SUBMISSION_ID = 2;
		MISSING_SUBMISSION_TYPE = 3;
		MISSING_UPLOAD_STATUS = 4;
	}

	ErrorStatus error = 1;
	PlayerSubmissionTypeProto submission_type = 2;
	string poi_id = 3;
}
